      ]
    }
  },
  methods: {
    whatsappFunction() {
      this.$refs.whatsapp.click();
    },
    next() {
      if( this.currentIndex >= this.slides.length-1) {
        this.currentIndex = 0
      } else {
        this.currentIndex++
      }
      this.name = 'left'
    },
    prev() {
      if( this.currentIndex <= 0) {
        this.currentIndex = this.slides.length-1
      } else {
        this.currentIndex--
      }
      this.name = 'right'
    }
  },
  mounted() {
    //this.sliding()
  },
  computed: {
    
  }
  
}
</script>

